import React from "react";
import "./BancoDados.css";
import { Link } from "react-router-dom";
import Header from "../../components/Header";

function BancoDados() {
    return(
        <>
            <Header/>
            <h1>Isso eh um banco de dados</h1>
        </>
    );
}

export default BancoDados;
